import React from "react";
import Messages from "./Messages/Messages"
import User from "./User/User";

const Navbar = () => {
    return (
        <nav className='nav'>
            <User/>
            <Messages/>
            <hr />
            <div>
                <a>News</a>
            </div>
            <div>
                <a>Music</a>
            </div>
            <div>
                <a>Settings</a>
            </div>
        </nav>
    );
}

export default Navbar;
